// Libraries
import React from "react";
import ReactDOM from "react-dom";
import reportWebVitals from './reportWebVitals';

// Style Sheets
import "./maps/styles.css";

// React Elements
import App from "./app/App"
import CountryMap from "./maps/MapChart";
import WorldMap from "./maps/map"

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);


const countryMapElement = document.getElementById("country-map");
ReactDOM.render(CountryMap, countryMapElement);

const worldMapElement = document.getElementById("world-map");
ReactDOM.render(WorldMap, worldMapElement);


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
